import React from 'react';
import '../styles/menu.css'; // Make sure to import your CSS file
import menupic from '../assets/pexels-mister-mister-3490364.jpg';

function Menu() {
  return (
    <div>
      <main>
        <div className='pic' >
          <img src={menupic} alt='img'  />
        </div>
        <div className='tileheading'>
          <h1>Our Menu</h1>
        </div>
      </main>
    </div>
  );
}

export default Menu;
